import styled, { createGlobalStyle } from 'styled-components';
import logo from '../../images/logo.png';

export const Nav = styled.section`
    background: #F3A0A6;
    padding: 3em;

`;
export const Logo = styled.section`
    img {
        src={$logo}
        text-align: center;
        width: 83px;
        height: 86px;
        border-radius: 75px;
    }
`;
